import React from 'react';
import './Header.css';

export default () => {
    return(
        <header>
            <div className="header--logo">
                <a href="/">
                    <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Netflix_2015_logo.svg/799px-Netflix_2015_logo.svg.png" alt="Netflix"/>
                </a>
                <div className="header--user">
                <a href="/">
                    <img src="https://occ-0-1740-185.1.nflxso.net/dnm/api/v6/K6hjPJd6cR6FpVELC5Pd6ovHRSk/AAAABYkPhDkuvf4TRhu22CbhD1ghWbzOHDPjA_U9Pp7PPv4W25sjDR2ZSntUZ0fmZp30MyyjTAsbDaH2QXKG_E-44F8.png?r=071"/>
                </a>
                </div>
            </div>
        </header>
    );
}
